import React from "react";
import { Table } from "react-bootstrap";

function Tabla(props) {
  
  return (
    <Table>
      <thead>
        {props.contenido}
      </thead>

      <tbody>
        {props.content.map(props.func)}
      </tbody>
    </Table>
  );
}

export default Tabla;
